// Sample images bave been converted to base64 string for easy processing
let SAMPLE_IMAGE_1 = {
    base64:
        'data:image/jpeg;base64,'
};
let SAMPLE_IMAGE_2 = {
    base64:
        'data:image/jpeg;base64,'
};
let SAMPLE_IMAGE_3 = {
    base64:
        'data:image/jpeg;base64,'
};
let SAMPLE_IMAGE_4 = {
    base64: 'data:image/jpeg;base64,'
};
let SAMPLE_IMAGE_5 = {
    base64: 'data:image/jpeg;base64,'
};
let SAMPLE_IMAGE_6 = {
    base64: 'data:image/jpeg;base64,'
};

let sampleImagesSG = [SAMPLE_IMAGE_1, SAMPLE_IMAGE_2, SAMPLE_IMAGE_3],
    sampleImagesJP = [SAMPLE_IMAGE_4, SAMPLE_IMAGE_5, SAMPLE_IMAGE_6];

renderSampleImages = () => {
    $('#sample-images').empty();
    let sampleImages;
    if (state.location === 'location-sg') {
        sampleImages = sampleImagesSG;
    } else {
        sampleImages = sampleImagesJP;
    }
    sampleImages.forEach((e) => {
        let image = document.createElement('IMG');
        Object.assign(image, {
            src: e.base64,
            id: `SAMPLE_IMAGE_${sampleImages.indexOf(e) + 1}`
        });
        $(image).attr('onclick', 'selectImage(this)');
        $('#sample-images').append(image);
    });
};

// Render sample images from base 64 sring to #sample-images
renderSampleImages();

